INSERT INTO `pwc_db_events` (`id`, `slug`, `title`, `date`, `time`, `location`, `organizer_name`, `organizer_email`, `organizer_phone`, `about`, `img`, `other_details`) VALUES
(1, '4th-battle-of-the-prides', '4th Battle of the Prides (Annual Hockey Encounter)', '2023-09-01', '15:00:00', 'Colombo Malay Grounds', 'Prince of Wales\' College, Moratuwa', '', '94', 'Join us on September 1st at Malay Grounds, Colombo, as the ice heats up for the 4th Hockey encounter between Prince of Wales College, Moratuwa, and Presidents College, Maharagama!  <br><br> Witness an epic clash of skills, determination, and school pride!', '815890952-hockey-big-match.jpg', 'No Information'),
(2, '147th-anniversary-pirith-and-alms-giving', 'Pirith and Alms Giving (147th Anniversary)', '2023-09-13', '21:00:00', 'School Main Hall', 'PWC', 'info@princeofwales.edu.lk', '0112645628', 'The holy hour, which is lined up properly for the wonderful moment of Kumara Vidhu Bima, a sacred ground blessed by Seth Pathumavas to open the future of a proud history of 147 years....', 'pirith-event-pwc.webp', 'No information'),
(3, 'cambrian-dinner-dance-2023', 'Cambrian Dinner Dance 2023', '2023-10-14', '19:30:00', 'Waters Edge, Battaramulla', 'OBA', 'media@pwcoba.lk', '0112645336', 'Cambrians Are you Ready to Party! Cambrian Dinner Dance 2023, Keep the Date Free... 14th October, Saturday  Tickets will be Available Soon for Online VISA/MASTER cards!  Stay Tuned, and don\'t forget to keep the date free.', '1040048686-373662867_632755345656187_5316122287395985578_n.jpg', '7:30pm - 2:00am: Full Event'),
(4, 'enthrone23', 'Enthrone \'23 | Prefects\' Day', '2023-09-30', '14:00:00', 'Main Hall', 'Prefects\' Guild', 'unknown', 'unknown', 'Towards the steps of pride we are ready to take the throne.\r\n\r\n#enthrone23 #prefectsday #princeofwalescollegeprefectsguild #Cambrians', 'prefects-day23.jpg', 'No Information'),
(5, 'teachers-day-2023', 'Teachers\' Day Celebration 2023', '2023-10-06', '07:30:00', 'Main Grounds', 'PWC', '', '', 'Prince of Wales College came alive with gratitude and joy as students, staff, and administrators united to celebrate Teachers\' Day with enthusiasm and appreciation.  The festivities kicked off with a special assembly, where students expressed their gratitude through heartfelt speeches, poems, and musical performances dedicated to the dedicated educators who shape their academic journey.  A highlight of the day was the heartfelt messages and tokens of appreciation presented to each teacher, acknowledging their unwavering commitment to nurturing minds and fostering a love for learning.  The atmosphere resonated with warmth and camaraderie as students and teachers engaged in various activities, strengthening the bond that forms the foundation of Prince of Wales College\'s educational community. Teachers\' Day at the college was a resounding success, leaving an indelible mark of appreciation and gratitude for the mentors who play a pivotal role in shaping the future leaders of tomorrow.', '782136971-385312395_840134097893610_8932198999570079468_n.webp', 'No Information'),
(6, 'christmas-carols-2023', 'Cambrians\' Christmas Carols 2023', '2023-12-20', '18:00:00', 'Main Hall', 'Christian & Catholic Society', '', '', 'Once again the Season for Love, Joy & and Laughter begins! The feeling of Christmas Season.let there be light in this Christmas. Cambrian Christmas Carols 2023. <br><br>Jointly organized by the Christian & Catholic Society along with the Old Boys\' Association of Prince of Wales\' College.', '1256942042-408334361_394252832929171_7356119707673183929_n.webp', 'No Information'),
(7, 'event-enchanted-wes', 'කලඑළි බසින නර්තන මෞලි මංගල්‍ය්‍ය', '2023-12-14', '00:00:00', 'College Main Ground', 'Dancing Society', '', '', 'n a celebration that promises to elevate local dance traditions to new heights, the upcoming Head Mask and Pedestrian Festival invites everyone to witness a mesmerizing display of talent. This festival is set to turn a new chapter in the world of school dance, showcasing the refined skills of both princes and princesses.', '1855261978-409808918_883735846866768_3090216312427899459_n.jpg', ''),
(8, 'cambrian-carnival-23', 'Cambrian Carnival & Exhibition 2023', '2023-12-27', '18:00:00', 'Main Grounds', 'PWC', '', '0773612757', 'Experience the unforgettable Cambrian Carnival \'23! Join us from 27th to 31st December at Prince of Wales’ College grounds for an educational exhibition, food festival, and live music from 5 amazing bands!', '1943533129-12-23-carnival.webp', 'bringing the best bands to Moratuwa.. WAYO, SEEDUWA LEGENDS, MIDLANE..  Cambrian Carnival & Education Exhibition 2023 Once again It\'s the time of the year for the best entertainment of the town presented by the Prince of Wales\' College Old Boys\' Association, who have been the Pioneers of bringing the best carnival experience to Moratuwa for decades and they are back this time with the latest and the best entertainment package with the most popular bands and artists in the island. Please keep the dates free for a year\'s end with a whole lot of fun and entertainment with the best Carnival experience you can get, come along with your families and friends for a fun full of Christmas Week till the year-end 31st Night.'),
(9, 'golden-hunters-24', 'Golden Hunters \'24', '2024-03-03', '13:30:00', 'PWC', 'Prefects\' Guild', '', '', 'Date Confirmed!... The official parade of prince of wales\' college \"Golden Hunters\" will be held on 3rd of March at 1.30 p.m.  Cambrians get your Golden Rides ready', 'cheer-Recovered.webp', '');
INSERT INTO `pwc_db_news` (`id`, `slug`, `title`, `content`, `photo`, `posted`, `date`, `author`, `category`, `categoryslug`, `excerpt`, `schoolPride`) VALUES
(1, 'cambrians-achieved-three-1st-places-in-provincial-level-western-music-competitions-2023', 'Cambrians Achieved Three 1st Places in Provincial Level Western Music Competitions 2023', 'The Senior Choir from Prince of Wales College claimed the 1st place 🥇, showcasing their exceptional musical prowess. The Junior Choir also brought home the 1st place 🥇, displaying their impressive skills at a young age. Adding to their victories, Rometh Thenuka from 9B amazed the judges with a stellar recorder solo, securing the 1st place 🥇 in that category. <br><br>\r\n\r\nSuch outstanding performances have not only brought pride to Prince of Wales College but have also earned them a well-deserved ticket to the National level competition. Their hard work and dedication have paid off, as they now get ready to represent their college on a larger stage. <br><br>\r\n\r\nA heartfelt congratulations to all the talented participants from Western Music Society of Prince of Wales College! 🎉🎉 Your musical achievements are an inspiration to the entire community. 🎶👏', 'wm-competitions-2023-pwc.webp', '', '2023-08-29', 'CMBU', 'Aesthetic', 'aesthetic', 'In the recent provincial-level Western Music competition, Prince of Wales College achieved a remarkable feat by securing three 1st places. The college', 'ON'),
(2, 'the-senior-and-junior-choirs-of-prince-of-wales-college-won-2nd-place-in-the-all-island-western-music-competition', 'The Senior and Junior Choirs of Prince of Wales\' College won 2nd Place in the All-Island Western Music Competition', 'Great news! Our choir groups have won 2nd place in the All Island Western Music Competition - Junior and Senior Choir. The competition took place at the National College of Education in Maharagama.  \r\n<br><br>\r\nWe want to give a big congratulations to our talented singers for their fantastic performance. \r\n<br><br>\r\nThe choir groups worked hard and practiced under the guidance of dedicated teachers, Mrs. Anne Shaluka and Mrs. Deepthika Ranasinghe.  Well done to everyone involved in this achievement!', '252941670-choir-(2).webp', '', '2023-09-11', 'CMBU', 'Aesthetic', 'aesthetic', 'Great news! Our choir groups have won 2nd place in the All Island Western Music Competition - Junior and Senior Choir. The competition took place at t', 'ON'),
(3, 'wales-handball-team-takes-second-place-in-under-16-all-island-tournament', 'Wales Handball Team Takes Second Place in Under-16 All-Island Tournament', 'In a thrilling showdown, the Wales Handball Team secured second place in the Under-16 All-Island Handball Tournament, held in Kuliyapitiya Central. The final match, which took place against the host team, Kuliyapitiya Central, ended with a nail-biting score of 5-6 in favor of the local team. <br><br> Under the guidance of Coach Mr. Suminda Karunarathne and the Master in Charge (MIC) Mrs. Aruni Jayawardane, the Wales Handball Team exhibited exceptional skills and teamwork throughout the tournament. Despite their commendable efforts, they narrowly missed out on the championship but left a lasting impression with their remarkable performance. <br><br> The tournament, which brought together young handball enthusiasts from across the island, showcased the growing talent and passion for the sport in Wales. The Wales Handball Team\'s journey to the finals was a testament to their dedication and hard work, earning them well-deserved recognition. <br><br> The Wales Handball Team\'s outstanding performance in the Under-16 All-Island Tournament has not only raised their profile but also inspired young handball players to follow in their footsteps. This tournament serves as a stepping stone for these aspiring athletes, providing a platform to hone their talents and compete at a higher level in the future.', '1529616043-handball.webp', '', '2023-09-10', 'CMBU', 'Sports', 'sports', 'In a thrilling showdown, the Wales Handball Team secured second place in the Under-16 All-Island Handball Tournament, held in Kuliyapitiya Central. Th', 'ON'),
(4, 'college-147-birthday-announcement', 'ශ්‍රේෂ්ඨ වේල්ස් මවුන්ගේ 147 වන ජන්ම දිනය පිළිවෙතට මුල් තැන දෙමින් ආගමානුකූලව සමරමු - විදුහල්පති නිවේදනය', 'ඔබ දැනටමත් දන්නා පරිදි වේල්ස් කුමර විද්‍යාල මාතාවගේ 147 වන ජන්ම දින සැමරුම වෙනුවෙන් පැවැත්වෙන  සර්වරාත්‍රික පිරිත් පිංකම දහතුන් වන බදාදා රාත්‍රියේත් සංඝයා වහන්සේ විෂයෙහි දානමය පිංකම බ්‍රහස්පතින්දා උදෑසන කාලයේදීත් විද්‍යාල පරිශ්‍රයේදී පැවැත්වේ.<br><br>\r\n\r\nපිරිත් සජ්ඣායනය සඳහා ස්වාමීන් වහන්සේලා හතළිස් නමක් වැඩම කිරීමට නියමිත අතර දානමය පුණ්‍ය කර්මය සඳහා ස්වාමීන් වහන්සේලා තිස් පස් නමක් වැඩම කිරීමට නියමිත ය. <br><br>\r\n\r\nමෙම මාහැඟි පිංකම සඳහා ඔබ සැමට ගෞරවයෙන් ඇරයුම් කරන අතර ඒ සදහා සුවිශේෂී ව දායකවීමට කැමති පින්වතුන් වෙතොත් අංශ ප්‍රධාන ගුරුභවතුන් හෝ දායකවීමට කැමැති ආදි ශිෂ්‍යයන් වෙතොත් ආදි ශිෂ්‍ය සංගමය අමතන මෙන් දන්වමි.<br><br>\r\n\r\nඑසේම 147 වන ජන්ම දිනයට සමගාමී කතෝලික ආගමික ආශිර්වාද දේව මෙහෙය ශුද්ධ වූ එම්මානුවෙල් දේවස්ථානයේදී පහළොස් වන දින උදෑසන පැවැත්වේ. මෙම අවස්ථාවට වේල්ස් කුමර විද්‍යාලය සමග වේල්ස් කුමරි විද්‍යාලය ද ඒකාබද්ධව සම්බන්ධවන බැවින් විද්‍යාල ද්විත්වයටම අදාළ සමස්ත ප්‍රජාවට එම අවස්ථාවට සම්බන්ධ වන මෙන් ගෞරවයෙන් ආරාධනා කර සිටිමි.<br><br>\r\n\r\nඅප ශ්‍රේෂ්ඨ වේල්ස් මවුන්ගේ 147 වන ජන්ම දිනය පිළිවෙතට මුල් තැන දෙමින් ආගමානුකූලව සමරමු..\r\nචිරන් ජයතු වේල්ස් මවුනි...!🌹🌹🌹<br><br>\r\n\r\nවිදුහල්පති<br>\r\nවේල්ස් කුමර විද්‍යාලය.', '09-11.webp', '', '2023-09-12', 'Principal', 'Announcements', 'announcements', 'වේල්ස් කුමර විද්‍යාල මාතාවගේ 147 වන ජන්ම දින සැමරුම වෙනුවෙන් පැවැත්වෙන  සර්වරාත්‍රික පිරිත් පිංකම දහතුන් වන බදාදා රාත්‍රියේත් සංඝයා වහන්සේ විෂයෙහි දාන', 'OFF'),
(5, 'under-16-basketball-team-of-prince-of-wales-college-crowned-as-the-champions-of-western-province', 'Under-16 Basketball Team of Prince of Wales College Crowned as the Champions of Western Province', 'Cambrian Basketball team became champions in the western province basketball tournament.The tournament which was taken place at Royal College sports complex and the finals were held between Prince Of Wales college and Loyola college Negombo.After a heated up match between two schools,scores ended up as 51 to 47 <br><br> Cambrian\'s team which was captained by Nejan Fernando was able to achieve this victory under the guidance of the head coach Mr.Tharaka Dharmakumara and Masters In charge Mrs.Himali Sewwandi and Mrs.Chamalka Dissanayaka.Cambrian basketball team showcased their outstanding talents and skills throughout the tournament. <br><br> Such extraordinary performance has brought pride to our alma mater.At last a heartful congratulations to all the talanted basketball players of cambrian basketball team.', '1186430182-basketball-09-16-pwc.webp', '', '2023-09-15', 'CMBU', 'Sports', 'sports', 'Cambrian Basketball team became champions in the western province basketball tournament.The tournament which was taken place at Royal College sports c', 'ON'),
(6, 'wales-carrom-team-secures-second-place-in-under-20-boys-category-at-all-island-school-games-2023', 'Wales Carrom Team Secures Second Place in Under-20 Boys Category at All Island School Games 2023', 'In an exciting match at the All Island School Games 2023, organized by the Ministry of Education, the carrom team from Prince of Wales College, Moratuwa, achieved a remarkable feat. They secured the runners-up position in the under-20 boys category, showcasing their impressive skills and teamwork. Coach Mr. Dinesh Nishantha Fernando\'s guidance and the hard work of the young players brought them to this significant achievement, making their school proud. <br><br> This accomplishment highlights the dedication and sportsmanship of the students from Prince of Wales College, Moratuwa, as they competed on a national level. The carrom team\'s success in the tournament serves as an inspiration to their fellow students and encourages the development of sports in the school.', '1710761248-achivements-carrom-(2).webp', '', '2023-09-19', 'CMBU', 'Sports', 'sports', 'In an exciting match at the All Island School Games 2023, organized by the Ministry of Education, the carrom team from Prince of Wales College, Moratu', 'ON'),
(7, 'cambrian-wrestlers-eraned-runners-up-title-in-the-national-stage', 'Cambrian Wrestlers Eraned Runners Up Title in the National Stage', 'At the National Wrestling Meet, the students from Prince of Wales College in Moratuwa did really well. They didn\'t win the top prize, but they became proud runners-up. This means they were second-best in the whole country! <br><br> These young wrestlers worked really hard and showed how determined they were. They left a big impression on the national stage because of their effort. <br><br> We want to say a big thank you to their coach. The coach helped them a lot and without the coach, they couldn\'t have done this well. The coach trained and guided them, and it made a big difference in their journey at the National Wrestling Meet.', '441935520-achivements-3-copy-(2).webp', '', '2023-09-20', 'CMBU', 'Sports', 'sports', 'At the National Wrestling Meet, the students from Prince of Wales College in Moratuwa did really well. They didn\'t win the top prize, but they became ', 'ON'),
(8, 'gold-medal-glory-for-young-wrestlers-at-national-wrestling-meet-2023', 'Gold Medal Glory for Young Wrestlers at National Wrestling Meet 2023', 'Our young wrestling champions, Mewan Sankalpa (U18, 45kg), Dinith Liyanage (U18, 51kg), and Seneru Dilmith (U16, 52kg), have made us incredibly proud! They won gold medals at the National Wrestling Meet. <br><br> A special thanks goes to their dedicated coach, who played a crucial role in their success. Hats off to their coach for their outstanding guidance and support! <br><br> Congratulations to these talented wrestlers.. You are true champions!', '1826833991-achivements-copy-(2).webp', '', '2023-09-20', 'CMBU', 'Sports', 'sports', 'Our young wrestling champions, Mewan Sankalpa (U18, 45kg), Dinith Liyanage (U18, 51kg), and Seneru Dilmith (U16, 52kg), have made us incredibly proud!', 'ON'),
(9, 'prince-of-wales-college-karate-team-wins-1st-place-in-western-province-kumite', 'Prince of Wales College Karate Team Wins 1st Place in Western Province Kumite', 'The karate team from Prince of Wales College did really well and got 1st place in the Western Province Kumite competition. The team members are Pudam Nethvidu, Hasindu Fernando, and Nelindu Jayasahan. They are all very talented in karate.<br> <br> The team wants to say a big thank you to their coach and the teachers who helped them. Without their help, they couldn\'t have won. So, they are very grateful to their coach and teachers for their support and guidance.', '1254165904-achivements-1.webp', '', '2023-10-02', 'CMBU', 'Sports', 'sports', 'The karate team from Prince of Wales College did really well and got 1st place in the Western Province Kumite competition. The team members are Pudam ', 'ON'),
(10, 'sri-lanka-school-u18-rugby-10s-bowl-champions', 'Sri Lanka School U18 Rugby 10\'s Bowl Champions', 'In a thrilling final match, Prince of Wales College Rudby team faced off against Lumbini and emerged victorious as the U18 Rugby 10\'s Bowl Champions. The final match took place at 12:00, and it was an exciting game. <br><br> The team wants to express their gratitude to their coach and the teachers who helped them along the way. Their support and guidance played a crucial role in achieving this championship, and the team is very thankful for their efforts.', '22938104-rugby.webp', '', '2023-10-02', 'CMBU', 'Sports', 'sports', 'In a thrilling final match, Prince of Wales College (PWC) faced off against Lumbini and emerged victorious as the U18 Rugby 10\'s Bowl Champions. The f', 'ON'),
(11, 'prince-of-wales-college-defeats-royal-college-in-thrilling-basketball-match', 'Prince of Wales\' College Defeats Royal College in Thrilling Basketball Match', 'In a thrilling basketball match at Jaffna Hindu College Grounds, Prince of Wales\' College showcased their exceptional skills. They secured a significant victory against Royal College Colombo with a final score of 52 to 44. This impressive win highlights the strength of the Prince of Wales\' College basketball team in the All Island Under 17 National School Basketball Tournament 2023.\r\n<br><br>\r\nThis victory holds great importance for Prince of Wales\' College, and it\'s a fantastic display of their basketball prowess. Fans of the sport surely enjoyed this exciting game, which was a part of the prestigious All Island Under 17 National School Basketball Tournament 2023.', '1136682032-basketball-2023-10.webp', '', '2023-10-10', 'CMBU', 'Sports', 'sports', 'In a big basketball game at Jaffna Hindu College Grounds, Prince of Wales\' College did really well. They won against Royal College Colombo with a fina', 'ON'),
(12, 'congratulations-to-pkdps-alwis-on-achieving-the-title-of-regimental-sergeant-major-in-2023', 'Congratulations to PKDPS Alwis on Achieving the Title of Regimental Sergeant Major in 2023!', 'In exciting news, a student from our school, Prince of Wales College in Moratuwa, has achieved a remarkable milestone. This student, PKDPS Alwis, was a highly respected Sergeant and Staff Sergeant Major in the Eastern Cadet Band at our school. They have surpassed all other Eastern Cadet Bands in Sri Lanka, making our school proud.\r\n<br><br>\r\nBut that\'s not all – in a historic moment for Prince of Wales, PKDPS Alwis has been honored with the prestigious rank of Regimental Sergeant Major in 2023. This honor was bestowed upon them by the National Cadet Corps, representing not only our school but the entire nation of Sri Lanka. \r\n<br><br>\r\nThis is a significant achievement, and we extend our warmest greetings and congratulations to PKDPS Alwis for this outstanding accomplishment.', '585981309-achivement231023.webp', '', '2023-10-23', 'CMBU', 'Aesthetic', 'aesthetic', 'He was a renowned Sergeant and Staff Sergeant Major of the Eastern Cadet Band in our school, surpassing all other Sri Lankan Eastern Cadet Bands.<br> ', 'OFF'),
(13, 'cambrian-shatters-records-with-15-48m-shot-put-throw', 'Cambrian Shatters Records with 15.48m Shot Put Throw', 'In a remarkable feat at the Piliyandala Zone competition, Don Mayon Chiran, a student at Prince of Wales\' College, Moratuwa, has achieved an outstanding victory in the Shot Put event. Chiran\'s incredible throw of 15.48 meters not only secured him first place but also set a new record in the competition, showcasing his exceptional talent and strength. <br><br> This achievement marks a proud moment for Prince of Wales College and highlights the potential of young athletes like Chiran. His dedication and determination have propelled him to the top, setting a new standard in Shot Put in the Piliyandala Zone.', '400916787-achivement-2-231023.webp', '', '2023-10-23', 'CMBU', 'Sports', 'sports', 'In a remarkable feat at the Piliyandala Zone competition, Don Mayon Chiran, a student at Prince of Wales\' College, Moratuwa, has achieved an outstandi', 'ON'),
(14, 'big-win-for-prince-of-wales-college-in-the-2023-under-14-basketball-tournament', 'Big Win for Prince of Wales\' College in the 2023 Under-14 Basketball Tournament', 'Exciting news from Negambo! The basketball team from Prince of Wales\' College had an amazing victory at the Under-14 Basketball Tournament. The tournament happened at the Negambo Magis Basketball Court, and it was full of exciting games. <br><br> The young players from Prince of Wales\' College showed their skills and hard work. They won the tournament and proudly held the Magis Trophy high. It\'s a moment of great pride for the college and shows the team\'s dedication. <br><br> The whole Prince of Wales\' College community is celebrating this win. It\'s a moment to remember. Congratulations to the fantastic team for their big victory!', '621447798-achivements-10-30-i.webp', '', '2023-10-30', 'CMBU', 'Sports', 'sports', 'Exciting news from Negambo! The basketball team from Prince of Wales\' College had an amazing victory at the Under-14 Basketball Tournament. The tourna', 'ON'),
(15, 'suwahas-fernando-shines-with-a-century-in-school-cricket-match', 'Suwahas Fernando Shines with a Century in School Cricket Match', '<p>Suwahas Fernando, a talented batsman from Cambrian College, showcased his skills in a remarkable manner during the Under 19 inter-school limited-over tournament clash between Prince of Wales’ College and St. Benedict\'s College.</p><p>In an outstanding display of batting prowess, Suwahas reached a century, achieving this feat off 136 balls. His innings was marked by precision and power, as he confidently struck 2 fours and impressive 6 sixes. This stellar performance not only contributed significantly to his team\'s success but also highlighted his potential as a standout player in school-level cricket.</p><p>The match became a memorable spectacle for fans and fellow players alike, with Suwahas Fernando\'s century standing out as a testament to his dedication and skill in the cricketing arena. As his innings unfolded, the crowd witnessed an exciting display of talent, leaving a lasting impression on the inter-school cricket tournament.</p>', '117760005-10-31.webp', '', '2023-10-31', 'CMBU', 'Sports', 'sports', '<p>Suwahas Fernando, a talented batsman from Cambrian College, showcased his skills in a remarkable manner during the Under 19 inter-school limited-ov', 'ON'),
(16, 'hasindu-sethsara-competes-in-south-asian-karate-championship', 'Pride of Prince of Wales College, Hasindu Sethsara, Competes in South Asian Karate Championship', '<p>In a moment of pride for Prince of Wales College, Hasindu Sethsara, a formidable karateka representing the Sri Lankan National Karate Team, has taken the stage at the South Asian Karate Championship in Kathmandu. The championship, spanning from Nov 28 to Dec 3, serves as a platform for top athletes across the region to showcase their martial arts prowess.</p><p>The entire Prince of Wales College community extends heartfelt congratulations and best wishes to Hasindu Sethsara as he competes on the international stage. His participation not only reflects his personal dedication and skill but also brings honor to the college and the nation. As the South Asian Karate Championship unfolds, the college community eagerly anticipates Sethsara\'s performance and wishes him success in this prestigious competition.</p><p>In this momentous occasion, the Prince of Wales College community stands united in support of Hasindu Sethsara, embodying the spirit of sportsmanship and camaraderie. The college takes pride in nurturing talents that reach such heights and wishes Sethsara the best as he represents not only himself and the national team but also the collective aspirations of his alma mater.</p>', '1216585982-11-25.webp', '', '2023-11-25', 'CMBU', 'Sports', 'sports', '<p>In a moment of pride for Prince of Wales College, Hasindu Sethsara, a formidable karateka representing the Sri Lankan National Karate Team, has tak', 'ON'),
(17, 'uneth-peiris-appointed-vice-captain-of-prince-of-wales-college-under-19-cricket-team', 'Uneth Peiris Appointed Vice-Captain of Prince of Wales\' College Under-19 Cricket Team', '<p>The Prince of Wales\' College community celebrates a moment of achievement as Uneth Peiris is appointed the Vice-Captain of the Under-19 cricket team. This significant role not only recognizes Uneth\'s cricketing prowess but also his leadership qualities, making him a valuable asset to the team.</p><p>As Vice-Captain, Uneth Peiris is poised to play a crucial role in guiding and motivating his teammates. The college extends hearty congratulations to Uneth, encouraging him to continue shining on the cricket field and making the institution proud.</p><p>The Prince of Wales\' College community stands united in support of Uneth Peiris, confident that his dedication and skills will contribute to the team\'s success. As he takes on this leadership role, the college eagerly anticipates witnessing Uneth\'s continued excellence and leadership in the realm of school cricket.</p>', '1357937105-11-25(2).webp', '', '2023-11-25', 'CMBU', 'Sports', 'sports', '<p>The Prince of Wales\' College community celebrates a moment of achievement as Uneth Peiris is appointed the Vice-Captain of the Under-19 cricket tea', 'OFF'),
(18, 'exceptional-achievements-by-prince-of-wales-college-karate-stars-at-all-island-school-junior-karate-championship', 'Exceptional Achievements by Prince of Wales College Karate Stars at All Island School Junior Karate Championship', '<p>Prince of Wales College celebrates remarkable achievements by its karate stars at the All Island School Junior Karate Championship. Vihen Rathnayake and Lakira Nimsith showcased their skill in kata, reaching the prestigious Best 8 category. This accomplishment not only reflects their dedication to the sport but also positions them among the top performers in the competition.</p><p>Ashmina Dineth secured an impressive 2nd place in kata, demonstrating precision and technique that set her apart in the championship. Her success adds to the pride of Prince of Wales College, highlighting the excellence nurtured within the school\'s karate program.</p><p>The standout performance of Thisara Rathnayake is a beacon of success for Prince of Wales College. Thisara achieved a remarkable 2nd place in kata and an outstanding 1st place in kumite, showcasing a versatile skill set. The entire school community extends heartfelt congratulations to Vihen Rathnayake, Lakira Nimsith, Ashmina Dineth, and Thisara Rathnayake for their outstanding achievements at the All Island School Junior Karate Championship. These accomplishments not only bring glory to the individual athletes but also underscore the strength and talent of Prince of Wales College in the realm of junior karate.</p>', '863240243-11-28.webp', '', '2023-11-28', 'CMBU', 'Sports', 'sports', '<p>Prince of Wales College celebrates remarkable achievements by its karate stars at the All Island School Junior Karate Championship. Vihen Rathnayak', 'OFF'),
(21, 'official-website-launch', 'Website Launching Event of Prince of Wales\' College', '<p>Prince of Wales College marked a historic moment on September 15, 2023, with the official launch of its new website. The event, held at the college auditorium, was graced by the presence of a distinguished chief guest: a family member of the school\'s founder, Mr. Charles Henry de Soysa.</p>\n\n<div class=\"cincopa_responsive_iframe\" style=\"padding:56.25% 0 0 0;position:relative;\"><div class=\"cincopa_responsive_wrapper\" style=\"height:100%;left:0;position:absolute;top:0;width:100%;\"><iframe width=\"100%\" height=\"100%\" src=\"https://rtcdn.cincopa.com/iframe.aspx?fid=AsKAAJPCJU1U\" frameborder=\"0\" allowfullscreen scrolling=\"no\" allow=\"autoplay *; fullscreen *\"></iframe></div></div>\n', '15-09.webp', '', '2023-12-01', 'Admin', 'Exclusives', 'exclusives', '<p>Prince of Wales College marked a historic moment on September 15, 2023, with the official launch of its new website. The event, held at the college', 'ON'),
(22, 'grand-opening-of-new-ict-lab-at-prince-of-wales-college', 'Grand Opening of New ICT Lab at Prince of Wales College', '<p>Prince of Wales College takes a giant leap into the future of education with the grand opening of its state-of-the-art ICT Lab. This innovative facility promises to redefine the learning experience, providing students with access to cutting-edge technology in a dynamic and interactive environment.</p><p>The ribbon-cutting ceremony, attended by school officials, faculty, and excited students, marked a significant milestone for Prince of Wales College. The new ICT Lab is equipped with the latest computing resources, offering students a hands-on experience in exploring the world of Information and Communication Technology.</p><p>The college community is enthusiastic about the opportunities this new facility brings, fostering a culture of digital literacy and technological innovation. As the doors of the ICT Lab swing open, Prince of Wales College reaffirms its commitment to preparing students for the challenges of the digital age.</p>\n\n<div class=\"cincopa_responsive_iframe\" style=\"padding:56.25% 0 0 0;position:relative;\"><div class=\"cincopa_responsive_wrapper\" style=\"height:100%;left:0;position:absolute;top:0;width:100%;\"><iframe width=\"100%\" height=\"100%\" src=\"https://rtcdn.cincopa.com/iframe.aspx?fid=AEHAYI_sJ0eT\" frameborder=\"0\" allowfullscreen scrolling=\"no\" allow=\"autoplay *; fullscreen *\"></iframe></div></div>\n', '570965631-15-11.webp', '', '2023-11-15', 'Admin', 'Exclusives', 'exclusives', '<p>Prince of Wales College takes a giant leap into the future of education with the grand opening of its state-of-the-art ICT Lab. This innovative fac', 'OFF'),
(23, 'online-application-for-advanced-level-2025', 'Online Application for Advanced Level Academic Year 2025 at Prince of Wales’ College', '<p>\n\nPrince of Wales’ College is now accepting online applications for Advanced Level Studies in the streams of Commerce, Arts, Technology, Biological and Physical Sciences. The deadline for submission is 08.12.2023.\n<br><br>\nTo apply, please click on the following link: \n<br><br>\n<a href=\"https://princeofwales.edu.lk/forms/apply-al/\">https://princeofwales.edu.lk/forms/apply-al/</a>\n<br><br>\nWith a proud history spanning 148 years, we invite you to become a part of the Cambrian community by joining Prince of Wales’ College. As a recruited student, you will have the unique privilege of celebrating our 150th anniversary as a Cambrian.\n<br><br>\nJoin us in shaping your future and becoming a proud member of the Cambrian community.\n\n</p>\n', '1370772860-01-12.webp', '', '2023-12-02', 'Principal', 'Announcements', 'announcements', '<p>Online Application for Advanced Level Academic Year 2025 at Prince of Wales’ College.</p><p>Prince of Wales’ College is now accepting online applic', 'OFF'),
(24, 'ranuth-kannangara-clinches-victory-in-junior-national-carrom-championship-2023', 'Ranuth Kannangara Clinches Victory in Junior National Carrom Championship 2023', '<p>A wave of pride sweeps through Prince of Wales’ College as Ranuth Kannangara emerges victorious in the Junior National Carrom Championship 2023. In an exhilarating match against Wariyapola Gnanodaya Central College, Ranuth showcased exceptional skill, securing a resounding victory.</p><p>The college community extends wholehearted congratulations to Ranuth Kannangara for his outstanding accomplishment in the national arena of carrom. His dedication, precision, and strategic prowess have not only brought honor to himself but also added another feather to the cap of Prince of Wales’ College in the field of sports.</p><p>Ranuth\'s triumph serves as an inspiration to aspiring carrom players within the college and beyond, reinforcing the values of hard work and perseverance. Prince of Wales’ College celebrates this momentous achievement and looks forward to witnessing Ranuth\'s continued success in the realm of carrom.</p>', '1859865361-399161920_860205279219825_3416034725638856441_n.webp', '', '2023-11-05', 'CMBU', 'Sports', 'sports', '<p>A wave of pride sweeps through Prince of Wales’ College as Ranuth Kannangara emerges victorious in the Junior National Carrom Championship 2023. In', 'ON'),
(26, 'sport-karate-bronze-medal', 'Rising Star Hasindu Fernando Secures Bronze at South Asian Karate Championship 2023', '<p>In a remarkable display of skill and determination, Hasindu Fernando clinched the Bronze Medal in the Junior Kumite (68Kg) category at the 7th South Asian Karate Championship 2023 held in Kathmandu, Nepal. The talented young karateka showcased exceptional prowess, bringing pride and honor to the nation.</p><p>Competing against fierce opponents from across the region, Hasindu Fernando exhibited unparalleled agility and precision in the Junior Kumite category. His dedication to the sport and countless hours of rigorous training paid off as he navigated through challenging bouts, ultimately earning him a well-deserved spot on the podium.</p><p>This significant achievement not only underscores Hasindu\'s individual prowess but also reflects the growing prowess of the country in the realm of martial arts. His success serves as an inspiration to aspiring athletes and highlights the potential for further excellence on the international stage. The entire nation joins in celebrating Hasindu Fernando\'s accomplishment, recognizing him as a rising star in the world of karate.</p><p>Hasindu\'s triumph in Kathmandu marks a milestone in his promising career and sets the stage for even greater accomplishments in the future. As the South Asian Karate Championship concludes, the young karateka\'s Bronze Medal is a testament to his hard work, skill, and resilience. The nation eagerly anticipates witnessing more victories from Hasindu as he continues to make strides in the world of karate and bring glory to the country.</p>', '1113214140-12-05-1.webp', '', '2023-12-06', 'CMBU', 'Sports', 'sports', '<p>In a remarkable display of skill and determination, Hasindu Fernando clinched the Bronze Medal in the Junior Kumite (68Kg) category at the 7th Sout', 'ON'),
(28, 'sport-west-league-basketball-championship', 'Prince of Wales\' College Under-16 Boys Triumph in STYP 3*3 CUP 2023 - West League Basketball Championship', '<p>In a stellar display of skill and teamwork, the under-16 boys\' basketball team from Prince of Wales\' College emerged victorious, clinching the STYP 3*3 CUP 2023 - West League Basketball championship. Congratulations are in order for the talented athletes who showcased their prowess on the court, bringing pride to their school.</p><p><i>Prince of Wales\' College\'s under-16 boys\' basketball team exhibited exceptional sportsmanship and determination throughout the STYP 3</i>3 CUP 2023 - West League Basketball championship. The team\'s success is a testament to their hard work, dedication, and effective coordination on the court. This victory not only brings honor to the players but also adds another feather to the cap of the esteemed school.*</p><p><i>The championship win marks a significant achievement for the Prince of Wales\' College sports program, highlighting the commitment to fostering young talent in the field of basketball. As the under-16 boys celebrate their triumph, the entire school community shares in the joy of this remarkable accomplishment. The team\'s accomplishment serves as an inspiration for aspiring young athletes and underscores the importance of perseverance in pursuing one\'s passion for sports.</i></p><p><i>Amidst cheers and applause, Prince of Wales\' College proudly basks in the glory of their under-16 boys\' basketball team\'s success, reinforcing their standing as a powerhouse in school sports. The STYP 3</i>3 CUP 2023 - West League Basketball championship win is not just a victory for the team but a moment of pride for the school and its supporters, celebrating the spirit of athleticism and excellence.*</p>', '12-18.webp', '', '2023-12-18', 'CMBU', 'Sports', 'sports', '<p>In a stellar display of skill and teamwork, the under-16 boys\' basketball team from Prince of Wales\' College emerged victorious, clinching the STYP', 'ON'),
(29, 'art-all-island-drama-competion', 'Prince of Wales\' College Shines Bright in 2023 All Island Drama Competition', '<p>In a spectacular display of theatrical excellence, Prince of Wales\' College has garnered noteworthy achievements in the 2023 All Island Drama Competition. A hearty congratulations is extended to the dedicated teachers and talented students of the Drama and Theatre department for their outstanding accomplishments across multiple categories.</p><p><i>The stage at the 2023 All Island Drama Competition was graced by the remarkable performances of Prince of Wales\' College, showcasing the depth of talent within the Drama and Theatre department. The collective efforts of the students and teachers were evident as they excelled in various categories, leaving an indelible mark on the competition. The school\'s commitment to fostering artistic expression and dramatic flair has undoubtedly played a pivotal role in these commendable achievements.</i></p><p><i>The accolades earned by Prince of Wales\' College in the All Island Drama Competition reflect the passion, creativity, and hard work invested by both students and educators. Whether it was the portrayal of captivating characters, flawless execution of scripts, or innovative staging, the school\'s presence was felt across multiple facets of the competition. This success not only adds to the school\'s artistic legacy but also serves as an inspiration for aspiring actors and dramatists.</i></p><p><i>As the curtain falls on the 2023 All Island Drama Competition, Prince of Wales\' College stands proud, having etched its name in the annals of dramatic accomplishments. The celebration of these achievements extends beyond the stage, resonating throughout the school community, as the collaborative efforts of teachers and students are recognized and applauded. The future of Drama and Theatre at Prince of Wales\' College looks bright, with this recent success setting the stage for even more remarkable performances to come.</i></p><p> </p><p> </p><p> </p><p><br> </p>', '12-18(2).webp', '', '2023-12-18', 'CMBU', 'Aesthetic', 'aesthetic', '<p>In a spectacular display of theatrical excellence, Prince of Wales\' College has garnered noteworthy achievements in the 2023 All Island Drama Compe', 'OFF'),
(30, 'clubs-quiz-champions', 'Prince of Wales\' College Quiz Club Secures Victory at Sri Sumangala College\'s Rhapsody \'23 English Day Quiz Championship', '<p>In a dazzling display of intellect and quick thinking, the Prince of Wales\' College Quiz Club emerged triumphant, clinching the overall championship title at the English Quiz held during <strong>Sri Sumangala College Panadura\'s </strong><i><strong>\'Rhapsody \'23</strong></i><strong>\' English Day</strong>. The competition, which brought together some of the brightest young minds in English language proficiency, showcased the outstanding quizzing prowess of the Prince of Wales\' College team.</p><p>The atmosphere was electric as participants engaged in a battle of wits, navigating through a series of challenging questions that tested their knowledge of English grammar, literature, and general language skills. The Prince of Wales\' College Quiz Club demonstrated exceptional teamwork and strategic thinking, securing a well-deserved victory. Their achievement not only highlights their dedication to academic excellence but also adds another feather to the cap of the prestigious Prince of Wales\' College.</p><p>The English Day at Sri Sumangala College Panadura served as a platform for students to showcase their linguistic talents and foster a spirit of healthy competition. The Quiz Club\'s success reflects not only on the individual members but also on the guidance and support provided by the educators and mentors who have nurtured their intellectual growth. The Prince of Wales\' College can now take pride in this significant win, further solidifying its reputation as a hub for academic excellence and overall development.</p>', '2019413162-congratz.webp', '', '2023-12-24', 'CMBU', 'Academic', 'academic', '<p><i>In a dazzling display of intellect and quick thinking, the Prince of Wales\' College Quiz Club emerged triumphant, clinching the overall champion', 'ON'),
(31, 'sport-judo', 'Sri Lankan Judoka Randidu Tadeesha Shines on International Stage at SANIX Team Judo Championship in Japan', '<p><i>Randidu Tadeesha, proudly representing the Sri Lankan National Judo Team, showcased remarkable skill and determination at the SANIX International Team Judo Championship held in Japan from December 22 to December 29. The championship brought together judo talents from around the world, providing a platform for athletes to display their prowess in the martial art.</i></p><p><i>Competing on an international stage, Randidu Tadeesha demonstrated exceptional technique and sportsmanship throughout the championship. Facing tough opponents, Tadeesha\'s commitment to the sport and rigorous training regimen was evident as he navigated the challenging matches. The representation of Sri Lanka in such a prestigious event not only highlights the individual athlete\'s dedication but also emphasizes the nation\'s growing presence in the global judo community.</i></p><p><i>The SANIX International Team Judo Championship not only serves as a test of skill but also fosters cultural exchange and camaraderie among participating nations. Randidu Tadeesha\'s participation in this event contributes to building bridges between Sri Lanka and the global judo community, fostering mutual respect and understanding. As Tadeesha returns home, his experience in Japan is sure to inspire aspiring judokas in Sri Lanka, adding a new chapter to the nation\'s judo journey.</i></p><p> </p><p> </p><p> </p><p><br> </p>', '1593831701-congratz-(2).webp', '', '2023-12-24', 'CMBU', 'Sports', 'sports', '<p><i>Randidu Tadeesha, proudly representing the Sri Lankan National Judo Team, showcased remarkable skill and determination at the SANIX Internationa', 'OFF'),
(33, 'best-of-luck-for-your-al-exams-2023', 'GCE A/L 2023 Students Gear Up for Success in Upcoming Exam', '<p><i>As the GCE A/L 2023 examinations approach, students across the nation are diligently preparing for the crucial tests that will determine their academic futures. The anticipation is palpable as they immerse themselves in rigorous study sessions and revision, fueled by the hope that their hard work will be met with success. Teachers, parents, and well-wishers are offering their support and encouragement, creating an atmosphere of unity and optimism among the student community.</i></p><p><i>With months of preparation behind them, the GCE A/L 2023 students are entering the final stretch of their academic journey. Many have sacrificed leisure time and devoted countless hours to mastering their subjects, and as the exams draw near, the pressure is undeniably high. However, the prevailing sentiment is one of determination, as these students strive to showcase their knowledge and skills on the examination papers. The support from educators and family members remains a driving force, fostering a sense of confidence and resilience among the candidates.</i></p><p><i>In the spirit of camaraderie and collective effort, the entire community wishes the GCE A/L 2023 students the very best in their upcoming exams. May their dedication and hard work translate into success, opening doors to new opportunities and academic pursuits. As they step into the examination halls, the collective hope is that each student\'s journey culminates in achievements that reflect the immense effort they have invested in their studies. Good luck to all the GCE A/L 2023 candidates - your success is eagerly awaited by those who have been part of your educational journey!</i></p>', '1377538589-untitled-1.webp', '', '2024-01-03', 'CMBU', 'Education', 'education', '<p><i>As the GCE A/L 2023 examinations approach, students across the nation are diligently preparing for the crucial tests that will determine their a', 'OFF'),
(35, 'international-library-day-2023-photo-album-released-prince-of-wales-college', 'Celebrating International Library Day 2023: Exclusive Photo Album Unveiled!', '<p>In a momentous event held on October 25th, the Prince of Wales College celebrated International Library Day 2023 in the grandeur of its main hall. The official photo album capturing the essence of this special day is now available for everyone to relive the memorable moments. From enthusiastic book lovers to the vibrant atmosphere, the album encapsulates the spirit of the event. Dive into the vivid memories and rediscover the joy of literature and knowledge shared on that remarkable day.</p><p>For a closer look at the captured memories, head over to the official CMBU Facebook page. The album is accessible <a href=\"https://www.facebook.com/100056910830114/posts/pfbid02ZDW43QcLfn5tBQW6WX5fdoj5XhFDCfzkBMwzAs1aGxYQtDUbhaUMpd72EYyiphJ9l/?mibextid=cr9u03\">here</a>. Join the community in celebrating the love for books, learning, and the rich cultural tapestry that makes International Library Day an event to remember.</p>', 'celebrating-international-library-day-2023:-exclusive-photo-album-unveiled!-blog-pwc.webp', '', '2023-10-29', 'CMBU', 'Exclusives', 'exclusives', '<p>In a momentous event held on October 25th, the Prince of Wales College celebrated International Library Day 2023 in the grandeur of its main hall. ', 'OFF'),
(36, 'sigithi-kumara-ragum-23-concert-prince-of-wales-college', 'Reliving the Enchantment: SIGITHI KUMARA RAGUM 23’ Concert at Prince of Wales’ College!', '<p>Experience the magic of the extraordinary concert, SIGITHI KUMARA RAGUM 23’, presented by the primary section of Prince of Wales’ College! The Little Cambrains, with their incredible talent, graced the grand stage at the school grounds, leaving the audience utterly spellbound. The performances ranged from stunning singing displays to mesmerizing dance routines, showcasing the Little Cambrains\' astonishing talents with unmatched enthusiasm.</p><p>Relive the enchantment by exploring the highlights of this exceptional concert on the official CMBU Facebook page <a href=\"https://www.facebook.com/100056910830114/posts/pfbid0WtxVdtEZi9RtxyUZzm3MHRjnDSb9SWmJ46wKQPtUjUKw75qSZA5sPyCp7QgqZVugl/?mibextid=Na33Lf\">here</a>. Immerse yourself in the world of music and dance that captivated the audience and celebrated the vibrant talents of Prince of Wales’ College\'s primary section.</p>', 'reliving-the-enchantment:-sigithi-kumara-ragum-23’-concert-at-prince-of-wales’-college!-blog-pwc.webp', '', '2023-10-31', 'CMBU', 'Exclusives', 'exclusives', '<p>Experience the magic of the extraordinary concert, SIGITHI KUMARA RAGUM 23’, presented by the primary section of Prince of Wales’ College! The Litt', 'OFF'),
(37, 'celebrating-literary-artistry-panhindaka-harasara-2023', 'Celebrating Literary Artistry: Panhindaka Harasara 2023', '<p>In the world of literature, a novel reflects the entirety of life, a short story crafts a small yet intricate piece of existence, and a poem serves as a gateway illuminating these experiences. Literature, in its entirety, is a captivating blend of these forms. It acts as a haven for a society of readers, exploring the delightful realms of such literary creations. The recent Panhindaka Harasara Sahitya Abhises Mangalotsavaya 2023, chaired by Mr. Kamal Valeboda, a senior professor at the University of Colombo, showcased the brilliance of two works by our own talented individuals.</p><p>Step into the realm of literary artistry and delve into the enriching experience of Panhindaka Harasara Sahitya Abhises Mangalotsavaya 2023. Discover more about this celebration on the official Cambrians Media Facebook page <a href=\"https://www.facebook.com/cambrians.media/posts/pfbid02tYuhqZoGjCFuCZGMuVzSMa1TnPEnekPDPGcFNAxfNR5dDj8aDNrJwQS141krCk4Dl\">here</a>, where the magic of words and creativity intertwines to celebrate the diverse facets of life through literature.</p>', 'celebrating-literary-artistry:-panhindaka-harasara-2023-blog-pwc.webp', '', '2023-11-02', 'CMBU', 'Exclusives', 'exclusives', '<p>In the world of literature, a novel reflects the entirety of life, a short story crafts a small yet intricate piece of existence, and a poem serves', 'OFF'),
(38, 'teachers-day-2023-album-out-prince-of-wales-college', 'Teachers Day Celebrations 2023: Album Out', '<p>In a heartwarming event, the board of prefects organized an unforgettable celebration dedicated to our remarkable teachers. Together, we paid tribute to their unwavering dedication and boundless passion, creating cherished memories that will forever inspire us. The event was a testament to the profound impact our teachers have on our lives, shaping our futures with their guidance and wisdom.</p><p>Explore the highlights of this heartening celebration on the official CMBU Facebook page <a href=\"https://www.facebook.com/100056910830114/posts/pfbid0E4HB2qjFnpRuHKp6GdQYuVm97iZZAagkwAQrGv5WqduGNg3eRPPfnntoJeegVZAdl/?mibextid=Na33Lf\">here</a>. Join us in expressing gratitude to the incredible educators who play a pivotal role in shaping the minds and hearts of the future generation.</p>', 'teachers-day-celebrations-2023:-album-out-blog-pwc.webp', '', '2023-10-11', 'CMBU', 'Exclusives', 'exclusives', '<p>In a heartwarming event, the board of prefects organized an unforgettable celebration dedicated to our remarkable teachers. Together, we paid tribu', 'ON'),
(39, 'kusal-mendis-appointed-26th-odi-captain-sri-lankan-cricket-team', 'Kusal Mendis Appointed as 26th ODI Captain for Sri Lankan Cricket Team', '<p>The Prince of Wales’ College community joyfully extends heartfelt congratulations to our esteemed alumnus, Kusal Mendis, on his appointment as the 26th ODI captain for the Sri Lankan cricket team in the ongoing World Cup match series.\n<br><br> This remarkable achievement not only reflects Kusal Mendis\' exceptional cricketing prowess but also makes the entire Prince of Wales’ College community proud. Wishing Kusal Mendis continued success and leadership as he takes on this prestigious role, showcasing the values instilled during his time at our esteemed institution.</p>', 'kusal-mendis-appointed-as-26th-odi-captain-for-sri-lankan-cricket-team-blog-pwc.webp', '', '2023-10-16', 'CMBU', 'Sports', 'sports', '<p>The Prince of Wales’ College community joyfully extends heartfelt congratulations to our esteemed alumnus, Kusal Mendis, on his appointment as the ', 'ON'),
(40, 'aesthetic-drama', 'Rising Star Shines Bright: Methika Navik Senarath Wins Special Jury Award at  the \"Pinnacle Sri Lanka 2023\" Award Ceremony!', '<p>In a dazzling display of talent, Methika Navik Senarath from Prince of Wales\' College has captured the hearts of the audience and the esteemed jury alike, earning the prestigious Special Jury Award for Best Child Actor at the \"Pinnacle Sri Lanka 2023\" Award Ceremony. The young actor\'s exceptional performance left a lasting impression, showcasing a remarkable ability to convey emotions on screen.</p><p><strong>Methika Navik Senarath\'s Journey to Stardom</strong></p><p>Methika\'s journey to this remarkable achievement is a testament to his dedication and passion for acting. The talented child actor not only displayed his natural flair for emotive storytelling but also worked tirelessly to perfect his craft. His commitment to his role resonated with the jury, earning him the well-deserved recognition as the Best Child Actor.</p><p><strong>A Proud Moment for Prince of Wales\' College</strong></p><p>The entire Prince of Wales\' College community is beaming with pride as Methika Navik Senarath brings honor to the institution. The school\'s commitment to nurturing talent and fostering a creative environment has once again borne fruit, with Methika\'s accomplishment adding another feather to the school\'s cap. The award is not just a celebration of Methika\'s success but also a reflection of the school\'s dedication to supporting and encouraging students to explore their passions beyond the classroom.</p>', 'aesthetic-drama-2024-02-06-blog-pwc.webp', '', '2024-02-05', 'CMBU', 'Aesthetic', 'aesthetic', '<p>In a dazzling display of talent, Methika Navik Senarath from Prince of Wales\' College has captured the hearts of the audience and the esteemed jury', 'ON');
INSERT INTO `pwc_db_news` (`id`, `slug`, `title`, `content`, `photo`, `posted`, `date`, `author`, `category`, `categoryslug`, `excerpt`, `schoolPride`) VALUES
(41, 'sport-karate', 'Triumph at All Island School Karate Championship 2023 for Prince of Wales\' College', '<p>In a display of exceptional skill and determination, Prince of Wales\' College has emerged victorious at the All Island School Karate Championship 2023. Aveesha Dinujaya showcased outstanding prowess by securing the 2nd place, while Ronal Randeera demonstrated remarkable talent, claiming the 3rd place in the fiercely competitive Under 16 Black Belt Kumite category. The school\'s dedication to martial arts excellence is evident in the commendable achievements of these young karate enthusiasts.</p><p><strong>Aveesha Dinujaya\'s Remarkable Feat</strong></p><p>Aveesha Dinujaya\'s impressive performance in the Under 16 Black Belt Kumite category is a testament to his relentless training and dedication. Securing the 2nd place is a significant accomplishment, highlighting not only his individual talent but also the effective coaching and support system provided by Prince of Wales\' College. The entire school community is filled with pride as Aveesha\'s success adds another chapter to the school\'s rich sporting legacy.</p><p><strong>Ronal Randeera\'s Podium Finish</strong></p><p>Ronal Randeera\'s stellar performance, securing the 3rd place in Under 16 Black Belt Kumite, further solidifies Prince of Wales\' College\'s dominance in the martial arts arena. His disciplined approach and strategic execution during the championship showcase the level of preparation and training that goes into honing the skills of the school\'s karate athletes. Ronal\'s achievement is not only a personal triumph but also contributes to the overall success of the school at the championship.</p><p><strong>Athintha Fernando\'s Advancement to Best 8</strong></p><p>Athintha Fernando\'s commendable progress to the Best 8 in Under 18 Black Belt Kata reflects the depth of talent within Prince of Wales\' College. His skillful execution of kata, a sequence of pre-arranged movements, highlights the meticulous training provided by the school\'s karate program. Athintha\'s advancement is a source of motivation for aspiring karate enthusiasts within the school and reinforces the institution\'s commitment to nurturing excellence in martial arts.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><br>&nbsp;</p>', 'triumph-at-all-island-school-karate-championship-2023-for-prince-of-wales\'-college-blog-pwc.webp', '', '2024-02-05', 'CMBU', 'Sports', 'sports', '<p>In a display of exceptional skill and determination, Prince of Wales\' College has emerged victorious at the All Island School Karate Championship 2', 'ON'),
(42, 'sport-prince-of-wales-college-emerges-victorious-in-cambrians-challenge-trophy-2024', 'Prince of Wales College Emerges Victorious in Cambrians Challenge Trophy 2024', '<p><i>In an exhilarating match-up, Prince of Wales College demonstrated their prowess on the court as they secured a remarkable victory over Wattala St. Joseph in the Cambrians Challenge Trophy 2024, showcasing their dominance in under-15 basketball.</i></p><p><strong>Royal Triumph:</strong> <i>Prince of Wales College\'s young athletes exhibited remarkable skill and determination throughout the game, showcasing their commitment to excellence. Their strategic maneuvers and seamless teamwork kept the audience captivated, ultimately leading to a triumphant win.</i></p><p><strong>Epic Showdown:</strong> <i>The showdown between Prince of Wales College and Wattala St. Joseph was nothing short of thrilling, with both teams displaying exceptional sportsmanship and competitive spirit. However, it was Prince of Wales College\'s unwavering resolve and impeccable performance that secured their place as champions of the Cambrians Challenge Trophy 2024.</i></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><br>&nbsp;</p>', 'prince-of-wales-college-emerges-victorious-in-cambrians-challenge-trophy-2024-blog-pwc.webp', '', '2024-02-25', 'CMBU', 'Sports', 'sports', '<p><i>In an exhilarating match-up, Prince of Wales College demonstrated their prowess on the court as they secured a remarkable victory over Wattala S', 'ON'),
(43, 'cambrians-legends-clinch-thrilling-24-run-victory-in-t20-match-2024', 'Cambrians Legends Clinch Thrilling 24-Run Victory in Legends Cricket Match', '<p>The Cambrians Legends emerged victorious in a thrilling T20 match held on March 17th, 2024, at the De Soysa International Cricket Stadium. They secured a dominant 24-run win over their opponents.</p><p>The scorecard shows that the Cambrians Legends batted first and scored 119 runs in their 15 overs. Their opponents, the Bastians Legends, were only able to manage 85 runs in their 13.2 overs.</p><p>This is a great win for the Cambrians Legends, and they will be hoping to continue their winning streak in their next match. </p>', 'cambrians-legends-clinch-thrilling-24-run-victory-in-t20-match-blog-pwc.webp', '', '2024-03-23', 'CMBU', 'Sports', 'sports', '<p>The Cambrians Legends emerged victorious in a thrilling T20 match held on March 17th, 2024, at the De Soysa International Cricket Stadium. They sec', 'ON');
